ISLAMABAD, Feb 9 (APP):Pakistan Muslim League-Nawaz candidate Sardar Ghulam Abbas has won the election for National Assembly constituency NA-59 Talagang-Cum-Chakwal by securing 141,680 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was independent candidate Roman Ahmed, who bagged 129,716 votes.
